var container = document.getElementsById("container");
for(var i=0; i<arr.length;i++)
{
    var content = arr[i];

    container.innerHTML = "";

    var div = document.createElement("div");
    div.classList.add("lists")

    var img = document.createElement("img");
    img.classList.add("sheets");
    img.src = arr.imageUrl;

    var contentDiv = document.createElement("div");
    contentDiv.classList.add("content");

    var titleP = document.createElement("p");
    titleP.classList.add("bold");
    titleP.textContent = arr.title;

    var descriptionP = document.createElement("p");
    descriptionP.classList.add("italic");
    descriptionP.textContent = arr.description;

    contentDiv.appendChild(titleP);
    contentDiv.appendChild(descriptionP);

    div.appendChild(img);
    div.appendChild(contentDiv);

    container.appendChild(div);
}                                                

